import React from "react";
import { Box } from "@mui/material";

function Footer() {
  return (
    <div>
      <Box>
        <p
          style={{
            textAlign: "center",
            backgroundColor: "#1A1A19",
            color: "white",
            fontSize: "20px",
            padding: "10px"
          }}
        >
          All Rights Reserved &copy; Chetan.info
        </p>
      </Box>
    </div>
  );
}

export default Footer;
